class Solution:
    def maxProduct(self, nums):
        if not nums:
            return None
        max_val = 1
        min_val = 1
        max_prod = float('-inf')

        for i in range(len(nums)):
            if nums[i] > 0:
                max_val *= nums[i]
                min_val = min(1, min_val * nums[i])
            elif nums[i] == 0:
                min_val = 1
                max_val = 0
            elif nums[i] < 1:
                prevMax = max_val
                max_val = min_val * nums[i]
                min_val = prevMax * nums[i]
            max_prod = max(max_prod, max_val)
            if max_val <= 0:
                max_val = 1
        return max_prod



